                curr = o.start;
            div.css("visibility", "visible");

            li.css({
                overflow: "hidden",
                float: o.vertical ? "none" : "left"
            });
            ul.css({
                margin: "0",
                padding: "0",
                position: "relative",
                "list-style-type": "none",
                "z-index": "1"
            });
            div.css({
                overflow: "hidden",
                position: "relative",
                "z-index": "2",
                left: "0px"
            });

            var liSize = o.vertical ? li.outerHeight(true) : li.outerWidth(true); // Full li size(incl margin)-Used for animation
            var margin = o.vertical ? css(li,"marginBottom") : css(li,"marginRight");
            var ulSize = liSize * itemLength; // size of full ul(total length, not just for the visible items)
            var divSize = liSize * v - margin; // size of entire div(total length for just the visible items)
            li.css({
                width: li.width(),
                height: li.height()
            });
            ul.css(sizeCss, ulSize + "px").css(animCss, -(curr * liSize));

            div.css(sizeCss, divSize + "px"); // Width of the DIV. length of visible images
            if (o.btnPrev) {
                $(o.btnPrev).click(function() {
                    return go(curr - o.scroll);
                });
            }
            if (o.btnNext) {
                $(o.btnNext).click(function() {
                    return go(curr + o.scroll);
                });
            }
